import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import {
  BrowserRouter as Router,
  Routes,
  Route,
} from 'react-router-dom';
import Blog from './Component/blog/Blog';
import Detail from './Component/blog/Detail';
import Index from './Component/member/Index';
import Register from './Component/member/Register';
import Account from './Component/blog/Account';
import My_product from './Component/blog/My_Product';
import Add_Product from './Component/blog/Add_product';
import Edit_product from './Component/blog/Edit_product';
import Home from './Component/blog/Home';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
  <Router>
    <App>
      <Routes>
        <Route index path='/' element = {<Home />} />
        <Route path='/blog/list' element = {<Blog />}/> 
        <Route path='/blog/detail/:id' element = {<Detail/>} /> 
        <Route path='/register' element = {<Register />} /> 
        <Route path='/login' element = {<Index />} />   
        <Route path='/account' element = {<Account />} />
        <Route path='/account/myproduct' element = {<My_product />} />
        <Route path='/account/addproduct' element = {<Add_Product />} />
        <Route path='/account/editproduct/:id' element = {<Edit_product />} />
      </Routes> 
    </App>
  </Router>
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
